import './Footer.css'

export class Footer extends Component {
    render() {
        return (
            <div className="footer"> 
            <div className="footer-logo">
            <img src="./images/image2.png" style="width:30px;height:30px;" /><br/><br/>
            </div>
            <p>Author: Emmanuel 
                9jaDiaspora Blogger 
                Web-Developer |
                Promoter and sales |
            &copy 2020 All right reserved </p>

        </div>



        )
    }
}

export default Footer
